import React from 'react';
import './App.css';



var nav = document.querySelectorById('bar'); 
console.log(nav);


function Text(){
   return (<div class="container"> <h1> Dise√±a tu hogar </h1>  <h2> Estiliza tu casa </h2>   </div> );
}


function Items(){
  return (
  <div className="items">
      <Item type="About"/>  
      <Item type="Proyect"/>  
      <Item type="Contact"/> 
  </div> );}
const Item = (props) => <a className="item" href="hello"> {props.type}</a>;
function Brand(){
  return <div className="brand">Logo corporativo</div> 
}
function App() {
  return (
    <div className="App" >
       <nav className="navbar">  <div class="bar"><Brand/>   <Items/> </div>   </nav> 
       <header className="header"> <Text/> </header> 
       <div className="spacing"> </div>
    </div>
  );
}

export default App;
